"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[53],{1109:o=>{o.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introdu\xe7\xe3o","href":"/tcc/docs/intro","docId":"intro"},{"type":"category","label":"Equipamentos","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Botoeiras:","href":"/tcc/docs/equipamentos/botoeiras","docId":"equipamentos/botoeiras"},{"type":"link","label":"Contatores","href":"/tcc/docs/equipamentos/contatores","docId":"equipamentos/contatores"},{"type":"link","label":"Temporizadores","href":"/tcc/docs/equipamentos/temporizadores","docId":"equipamentos/temporizadores"},{"type":"link","label":"Fus\xedvel","href":"/tcc/docs/equipamentos/fusivel","docId":"equipamentos/fusivel"},{"type":"link","label":"Motores","href":"/tcc/docs/equipamentos/Motores","docId":"equipamentos/Motores"},{"type":"link","label":"Disjuntores","href":"/tcc/docs/equipamentos/disjuntor","docId":"equipamentos/disjuntor"},{"type":"link","label":"LED","href":"/tcc/docs/equipamentos/LED","docId":"equipamentos/LED"}],"href":"/tcc/docs/category/equipamentos"},{"type":"category","label":"Acionamentos","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Intertravamento","href":"/tcc/docs/control-partida/intertravamendo","docId":"control-partida/intertravamendo"},{"type":"link","label":"Acionamentos de dispositivos de prote\xe7\xe3o","href":"/tcc/docs/control-partida/Acionamentos-os-dispositivos-de-prote\xe7\xe3o","docId":"control-partida/Acionamentos-os-dispositivos-de-prote\xe7\xe3o"},{"type":"link","label":"Partida direta","href":"/tcc/docs/control-partida/partida-direta","docId":"control-partida/partida-direta"},{"type":"link","label":"Partida com revers\xe3o","href":"/tcc/docs/control-partida/partida-com-revers\xe3o","docId":"control-partida/partida-com-revers\xe3o"},{"type":"link","label":"Partida Estrela - Tri\xe2ngulo","href":"/tcc/docs/control-partida/partida-estrela-tri\xe2ngulo","docId":"control-partida/partida-estrela-tri\xe2ngulo"},{"type":"link","label":"Partida compensada","href":"/tcc/docs/control-partida/partida-compensada","docId":"control-partida/partida-compensada"}],"href":"/tcc/docs/category/acionamentos"},{"type":"category","label":"Uso do Laborat\xf3rio","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Utiliza\xe7\xe3o do laborat\xf3rio","href":"/tcc/docs/tutorial-extras/uso-do-laborat\xf3rio","docId":"tutorial-extras/uso-do-laborat\xf3rio"}],"href":"/tcc/docs/category/uso-do-laborat\xf3rio"}]},"docs":{"control-partida/Acionamentos-os-dispositivos-de-prote\xe7\xe3o":{"id":"control-partida/Acionamentos-os-dispositivos-de-prote\xe7\xe3o","title":"Acionamentos de dispositivos de prote\xe7\xe3o","description":"Os equipamentos de prote\xe7\xe3o s\xe3o importantes para manter o circuito em bom estado, al\xe9m de manter o usu\xe1rio em seguran\xe7a quando houver sobrecarga e curto-circuito. O acionamento desses equipamentos necessita da instala\xe7\xe3o correta, para assegurar a prote\xe7\xe3o das pessoas que acionam esses dispositivos. No Laborat\xf3rio 4 do IFPR - C\xe2mpus Assis Chateaubriand s\xe3o utilizados os disjuntores e fus\xedveis como dispositivos de prote\xe7\xe3o. As instala\xe7\xf5es desses equipamentos s\xe3o feitas no in\xedcio do circuito especificamente em s\xe9rie.","sidebar":"tutorialSidebar"},"control-partida/intertravamendo":{"id":"control-partida/intertravamendo","title":"Intertravamento","description":"Todos os acionamentos feitos em laborat\xf3rio necessitam do contator, pois permitem ligar um equipamento sem um contato direto com a tens\xe3o do motor. Ao acionar uma contatora, \xe9 preciso que se mantenha acionada sem que o programador fique segurando a botoeira, para evitar isso utiliza-se o acionamento de intertravamento no contator. Para que isso ocorra \xe9 necess\xe1rio que a Botoeira Normalmente aberta (B1) fique em s\xe9rie com a Contatora (K1), e seu contato auxiliar em paralelo com K1 e o LED em paralelo com K1. E por fim, para que o acionamento desligue ap\xf3s ser ativado \xe9 necess\xe1rio haver uma Botoeira Normalmente fechada (B2) que esteja em s\xe9rie com B1.","sidebar":"tutorialSidebar"},"control-partida/partida-com-revers\xe3o":{"id":"control-partida/partida-com-revers\xe3o","title":"Partida com revers\xe3o","description":"Para a rota\xe7\xe3o em ambas as dire\xe7\xf5es do rotor \xe9 necess\xe1ria a troca de ordem das bobinas acionadas. Na realiza\xe7\xe3o da partida com revers\xe3o, a altera\xe7\xe3o da ordem deve ser por meio de contatores, al\xe9m disso, utilizam-se botoeiras, contatos auxiliares, dispositivos de seguran\xe7a: disjuntor e fus\xedvel e LEDs \u2013 para verifica\xe7\xe3o de funcionamento do comando.","sidebar":"tutorialSidebar"},"control-partida/partida-compensada":{"id":"control-partida/partida-compensada","title":"Partida compensada","description":"Acionamento de comando","sidebar":"tutorialSidebar"},"control-partida/partida-direta":{"id":"control-partida/partida-direta","title":"Partida direta","description":"Para realiza\xe7\xe3o do acionamento de um motor de forma direta, utiliza-se o \u201cPartida Direta\u201d, que por sua vez aciona o motor diretamente sem a necessidade de troca de ordem de p\xf3los. Por consequ\xeancia, inicia-se a partida direta em tri\xe2ngulo, evitando que o acionamento seja feito com 58% da tens\xe3o nominal.","sidebar":"tutorialSidebar"},"control-partida/partida-estrela-tri\xe2ngulo":{"id":"control-partida/partida-estrela-tri\xe2ngulo","title":"Partida Estrela - Tri\xe2ngulo","description":"O acionamento em estrela tri\xe2ngulo \xe9 necess\xe1rio para que o motor seja ligado em duas partes. \u201cO motor parte em estrela, isto \xe9, com uma tens\xe3o de 58%, da tens\xe3o nominal, e ap\xf3s certo tempo a liga\xe7\xe3o \xe9 convertida para tri\xe2ngulo, assumindo a tens\xe3o nominal\u201d. Para realiza\xe7\xe3o da programa\xe7\xe3o de comando \xe9 necess\xe1rio o uso de duas botoeiras, tr\xeas contatores, um temporizador, tr\xeas LEDs (para verifica\xe7\xe3o do acionamento das contatoras) e os dispositivos de seguran\xe7a.","sidebar":"tutorialSidebar"},"equipamentos/botoeiras":{"id":"equipamentos/botoeiras","title":"Botoeiras:","description":"As botoeiras s\xe3o equipamentos utilizados para o fechamento e a abertura de contatos, permitindo diversos acionamentos conforme a programa\xe7\xe3o desejada. Essas botoeiras podem operar em tr\xeas tipos de condi\xe7\xf5es","sidebar":"tutorialSidebar"},"equipamentos/contatores":{"id":"equipamentos/contatores","title":"Contatores","description":"Contatores s\xe3o dispositivos utilizados para acionar equipamentos que operam com tens\xf5es mais elevadas, como os motores trif\xe1sicos em aplica\xe7\xf5es industriais e residenciais. Seu fechamento \xe9 realizado por meio da ativa\xe7\xe3o eletromagn\xe9tica de sua bobina quando uma corrente \xe9 aplicada, e sua abertura ocorre com a atua\xe7\xe3o de uma mola quando n\xe3o h\xe1 corrente na bobina.","sidebar":"tutorialSidebar"},"equipamentos/disjuntor":{"id":"equipamentos/disjuntor","title":"Disjuntores","description":"A fun\xe7\xe3o primordial dos disjuntores \xe9 garantir a prote\xe7\xe3o e a seguran\xe7a dos circuitos el\xe9tricos. Al\xe9m disso, devido \xe0 sua estrutura mec\xe2nica, eles possibilitam o seccionamento de circuitos, permitindo a ativa\xe7\xe3o e a desativa\xe7\xe3o de cargas.","sidebar":"tutorialSidebar"},"equipamentos/fusivel":{"id":"equipamentos/fusivel","title":"Fus\xedvel","description":"Os fus\xedveis s\xe3o dispositivos de prote\xe7\xe3o utilizados para prevenir danos causados por excesso de corrente, evitando curtos-circuitos e sobrecargas de longa dura\xe7\xe3o nos equipamentos. Consistem em uma pequena liga met\xe1lica com baixo ponto de fus\xe3o. Quando a corrente excede o limite toler\xe1vel, o material funde-se, interrompendo o fluxo de corrente el\xe9trica. Os fus\xedveis s\xe3o montados em uma base de material isolante. Para dimensionar adequadamente esse dispositivo, \xe9 crucial considerar a corrente em que \xe9 projetado para suportar, garantindo que funcione apenas quando necess\xe1rio. Sua opera\xe7\xe3o envolve a conex\xe3o de sua entrada \xe0 fonte de alimenta\xe7\xe3o e sua sa\xedda \xe0 entrada do equipamento.","sidebar":"tutorialSidebar"},"equipamentos/LED":{"id":"equipamentos/LED","title":"LED","description":"Os sinalizadores s\xe3o equipamentos importantes para a identifica\xe7\xe3o de passagem de energia em um aparelho, podendo variar em sinais luminosos, sonoros e vibracionais. Podem ser utilizados tanto para verifica\xe7\xe3o de um motor acionado, quanto para uma irregularidade na instala\xe7\xe3o, um exemplo deles \xe9 o LED que utiliza com sinaliza\xe7\xe3o sinais luminosos.","sidebar":"tutorialSidebar"},"equipamentos/Motores":{"id":"equipamentos/Motores","title":"Motores","description":"No laborat\xf3rio 4 do IFPR - C\xe2mpus Assis Chateaubriand \xe9 ensinada a realiza\xe7\xe3o das partidas de motores, dentre elas a direta, com revers\xe3o, estrela tri\xe2ngulo e compensada. Para realiza\xe7\xe3o desses acionamentos s\xe3o utilizados motores trif\xe1sicos com 6 p\xf3los. A liga\xe7\xe3o dos p\xf3los podem variar entre: estrela ou tri\xe2ngulo","sidebar":"tutorialSidebar"},"equipamentos/temporizadores":{"id":"equipamentos/temporizadores","title":"Temporizadores","description":"O temporizador pode ser utilizado para ativar e desativar dispositivos conforme a necessidade do programador. O temporizador dispon\xedvel no laborat\xf3rio 4 do IFPR - C\xe2mpus Assis Chateaubriand, \xe9 do tipo comutador que redireciona a corrente de uma entrada para outra quando o tempo estipulado \xe9 excedido","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introdu\xe7\xe3o","description":"No curso T\xe9cnico em Eletromec\xe2nica do Instituto Federal do Paran\xe1 (IFPR), C\xe2mpus Assis Chateaubriand, primeiro, s\xe3o ensinados os conceitos b\xe1sicos em sala e, depois, os ensinamentos s\xe3o repassados e aprofundados por meio de aulas pr\xe1ticas a fim de criar uma maior inser\xe7\xe3o dos estudantes no mundo do trabalho. Al\xe9m de auxiliar no ensino de \u201cM\xe1quinas e Acionamentos\u201d visando amparar todas as diferentes formas de acionamento dos equipamentos.","sidebar":"tutorialSidebar"},"tutorial-extras/uso-do-laborat\xf3rio":{"id":"tutorial-extras/uso-do-laborat\xf3rio","title":"Utiliza\xe7\xe3o do laborat\xf3rio","description":"A seguran\xe7a em ambientes el\xe9tricos e rotativos \xe9 indubitavelmente importante. \xc0 vista disso, as Normas Regulamentadoras (NRs) amparam os indiv\xedduos, desempenhando um papel fundamental para a prote\xe7\xe3o no manuseio de equipamentos nesses ambientes.","sidebar":"tutorialSidebar"}}}')}}]);